import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule, Routes } from '@angular/router';
import { ViewEnquiryComponent } from 'src/app/crm/view-enquiry/view-enquiry.component';
import { ReqcibilComponent } from 'src/app/crm/reqcibil/reqcibil.component';
import { ApplyloanComponent } from 'src/app/crm/applyloan/applyloan.component';


const routes: Routes = [
  {
    path:"viewEnquiry",component:ViewEnquiryComponent
  },
  {
    path:"reqCibil",component:ReqcibilComponent
  },
  {
    path:"applyLoan",component:ApplyloanComponent
  }
];

@NgModule({
  declarations: [],
  imports: [
    RouterModule.forChild(routes)]
    CommonModule
  ],
  exports
})
export class CrmRoutingModule { }
